import React from 'react'
import LandingPage from './components/LandingPage'



const SignUp = () => {

    return (
        <div >

            <p>Here you should sign up</p>
            <NavLink tag={LandingPage} to="/LandingPage">
                Resume
</NavLink>;
        </div>
    )
}
export default SignUp;
